description:
Nile Lechwe (Kobus megaceros) in captivity at San Diego Zoo, San Diego, California, USA. Videotaped on 3 June 2002. See <a href="http://www.sandiegozoo.org/animalbytes/t-nile_lechwe.html" rel="noreferrer nofollow">www.sandiegozoo.org/animalbytes/t-nile_lechwe.html</a>

Image shows 
- male: very dark brownish with horns;
- female: light fawn without horns; 
- immature male: light fawn with small horns

From a video which can be seen at https://www.flickr.com/photos/arthur_chapman/5190940200
